INSERT INTO `ps_product_lang` VALUES (14,1,1,'<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 ‚ÄúThe shoe banned by the NBA‚Äù label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-phat-white-crimson-grey-gs','Nike Air Jordan I Phat White/Crimson/Grey GS AJ 1 2012 Women',NULL,'Air Jordan I Phat White/Crimson/Grey GS','Air Jordan I Phat White/Crimson/Grey GS',NULL,NULL),(14,1,2,'<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du mod√®le original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa premi√®re ann√©e en NBA, Michael Jordan a re√ßu le titre de Rookie de l‚Äôann√©e et a particip√© √† son premier All Star Game. La Air Jordan I a √©t√© la premi√®re basket multicolore √† √™tre port√©e en NBA, ce qui a entra√Æn√© son interdiction par la ligue. Si bien que, √† chaque match o√π Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a saut√© sur cette occasion pour promouvoir la Air Jordan 1 et a d√©cid√© de payer les amendes inflig√©es √† MJ. Ainsi, la paire a √©t√© surnomm√©e ‚Äúla paire interdite en NBA‚Äú. La Air Jordan est sorti