 of release: 2012</p>\r\n<p>The AJKO was originally released in 1985, the same year as Air Jordan I. It is very similar to it but was made of canvas instead of leather and AJKO is written on the Jordan wings logo instead of \"Air Jordan\". The meaning of the name \"KO\" is a bit mysterious, could be Knock Out, or Knock Off.</p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 ‚ÄúThe shoe banned by the NBA‚Äù label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-ko-white-black-varsity-red','Nike Air Jordan I KO White/Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO White/Black/Varsity Red','Air Jordan I KO White/Black/Varsity Red',NULL,NULL),(44,1,2,'<p>Ann√©e de sortie: 2012</p>\r\n<p>Le mod√®le AJKO original a vu le jour en 1985, ann√©e de la sortie de la Air Jordan I. Les 2 mod√®les sont tr√®s proches, principales diff√©rences: la AJKO est faite de toile et non de cuir, le logo Jordan Wings porte l\'inscription \"AJKO\" au lieu de \"Air Jordan\". La signification du nom \"KO\" reste myst√©rieuse, √ßa peut √™tre \"Knock Out\" ou \"Knock Off\".</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du mod√®le original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa premi√®re ann√©e en NBA, Michael Jordan a re√ßu le titre de Rookie de l‚Äôann√©e et a particip√© √† son premier All Star Game. La Air Jordan I a √©t√© la premi√®re basket multicolore √† √™tre port√©e en NBA, ce qui a entra√Æn√© son interdiction par la ligue. Si bien que, √† chaque match o√π Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a saut√© sur cette occasion pour promouvoir la Air Jordan 1 et a d√©cid√© de payer les amendes inflig√©es √† MJ. Ainsi, la paire a √©t√© surnomm√©e ‚Äúla paire interdite en NBA‚Äú. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a r√©√©dit√© le mod√®le mais il n‚Äôa pas eu le succ√®s commercial escompt√©. Depuis 2001, <br />la Air Jordan I est r√©guli√®rement r√©√©dit√©e dans diff√©rents coloris. En 2004, le mod√®le Low est <br />apparu suivi en 2008 du mod√®le Low Phat.</p>','<p>Ann√©e de sortie: 2012</p>','air-jordan-i-ko-white-black-varsity-red','Nike Air Jordan I KO White/Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO White/Black/Varsity Red','Air Jordan I KO White/Black/Varsity Red',NULL,NULL),(44,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(44,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(44,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,1,'<p>About Air Jordan VIII:</p>\r\n<p>Year of release of OG model: 1992</p>\r\n<p>In 1993, Michael Jordan and the Bulls win their 3rd NBA title in a row against Charles Barkley‚Äôs Phoenix Suns. MJ is once again MVP of the NBA finals.</p>\r\n<p>The most popular colorway of Air Jordan VIII, called ¬´ Aqua ¬ª, was only worn once by MJ : during ‚Äô93 NBA All Star Game in Salt Lake City.<br />The shoe uses advanced technology, anti-inversion straps, soles in polycarbonate. The colors are even more aggressive. The Air Jordan VIII changed the way high performance shoes were designed technologically and aesthetically. High-top sneaker made of black velours with diagonal <br />applications allover the lacing parts and an additional slim velcro. Perforations on the side parts.</p>','<p>Year of release: 2007</p>','air-jordan-viii-white-stealth-orange','Nike Air Jordan VIII White/Stealth/Orange AJ 8 Vintage 1991',NULL,'Air Jordan VIII White/Stealth/Orange','Air Jordan VIII White/Stealth/Orange',NULL,NULL),(65,1,2,'<p>A propos de la Air Jordan VIII:</p>\r\n<p>Date de sortie du mod√®le original: 1992</p>\r\n<p>A l‚Äôissue de la saison 1992-93, Micheal Jordan et les Bulls remportent leur 3√®me titre NBA cons√©cutif, face aux Phoenix Suns emmen√©s par Charles Barkley. Jordan est √† nouveau d√©sign√© MVP de la finale NBA.</p>\r\n<p>Le colori le plus populaire parmi les Air Jordan VIII, appel√© ¬´ Aqua ¬ª, a √©t√© port√© une seule fois par MJ lors du NBA All Star Game ‚Äô93 √† Salt Lake City. <br />La chaussure emploie des technologies de pointe pour l\'√©poque : des straps in√©dits et une semelle en polycarbonate. Les couleurs sont encore plus agressives. La Air Jordan VIII a chang√© la fa√ßon dont les chaussures de haute performance √©taient con√ßues, techniquement et esth√©tiquement.</p>','<p>Ann√©e de sortie: 2007</p>','air-jordan-viii-white-stealth-orange','Nike Air Jordan VIII White/Stealth/Orange AJ 8 Vintage 1992',NULL,'Air Jordan VIII White/Stealth/Orange','Air Jordan VIII White/Stealth/Orange',NULL,NULL),(65,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,1,'<p>In 2008, Jordan Brand released 11 different Countdown packages (almost one per month) in order to commemorate Air Jordans\' legacy. For each pack, the sum of the two pairs equals to 23. Countdown packages were the opportunity for Jordan Brand to offer to the fans reissues of each Air Jordan (from 1 to 22).</p>\r\n<p>¬†</p>\r\n<p>About Air Jordan II:</p>\r\n<p>Year of release of OG model: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p>In the 86-87 season, MJ scored an average 37.1 points per game and became the first player since Wilt Chamberlain to top 3,000 points in a season. Michael also played in the All-Star Game and won the Slam-Dunk Contest. <br />The Air Jordan II was designed by Bruce Kilgore and just as its predecessor it showed a great innovative design. Surprisingly, this is the only Air Jordan ever that has not been made in a black version (except retro versions). Nike swoosh logo disappears. Full-grain leather upper. Polyurethane midsole, encapsulated Air-Sole¬Æ unit in heel. Rubber outsole.</p>','<p>Year of release: 2008</p>','air-jordan-countdown-package-ii-xxi','Nike Air Jordan Countdown Package II & XXI AJ 2 21 2008',NULL,'Air Jordan Countdown Package II & XXI','Air Jordan Countdown Package II & XXI',NULL,NULL),(87,1,2,'<p>Au cours de l\'ann√©e 2008, Jordan Brand a sorti 11 Countdown packages afin de c√©l√©brer la \"dynastie\" des Air Jordan. Pour chaque pack, la somme des 2 paires est toujours √©gale √† 23. Ces packs ont √©t√© l\'occasion pour Jordan Brand de r√©√©diter l\'ensemble des mod√®les (de la Jordan 1 √† la 22).</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Jordan II:</p>\r\n<p>Date de sortie du mod√®le original: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p>Durant la saison 86-87, Jordan marqua 37.1 points de moyenne par match et devint le premier joueur depuis Wilt Chamberlian a d√©passer les 3000 points marqu√©s dans une saison. Michael Jordan fut s√©lectionn√© pour son 2√©me All-star game et remporta le slam-dunk contest. La Air <br />Jordan II a √©t√© dessin√©e par Bruce Kilgore et, comme la Jordan I, son design est particuli√®rement novateur.<br />Ce sera la seule Air Jordan √† ne pas poss√©der de version noire (mod√®les retro except√©s). Cot√© design, le swoosh dispara√Æt. Cuir sup√©rieur vein√©, semelle interm√©daire en polyur√©thane, syst√®me air dans la semelle au niveau du talon. Semelle en caoutchouc.</p>','<p>Ann√©e de sortie: 2008</p>','air-jordan-countdown-package-ii-xxi','Nike Air Jordan Countdown Package II & XXI AJ 2 21 2008',NULL,'Air Jordan Countdown Package II & XXI','Air Jordan Countdown Package II & XXI',NULL,NULL),(87,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(88,1,1,'<p>About Air Jordan XXIII:</p>\r\n<p>Year of release of OG model: 2008</p>\r\n<p>With the 23<sup>rd</sup> Jordan pair, Jordan Brand innovated again, starting from the toe. The toe cap has Jordan‚Äôs signature embossed. The side of the shoe features a stitched pattern that gives the shoes strength in addition to cosmetic effect. The tongue of the left and right are different for a first time with a Jumpman logo on the right shoe and the number 23 embedded on the left shoe. The Jumpman is completely missing on the left sneaker, except on the ends of the shoelaces. The shoe also features a glittery panel that covers the midsole body of the sneaker. This was the first Air Jordan that was engineered to not use any glue in order to make it more environmentally friendly, while the soles (which are designed from Jordan\'s own fingerprint) are made from recycled rubber.</p>\r\n<p>It is considered the most technologically advanced Jordan model to date, and according to Gentry Humphrey, the head of the Jordan design team, it may be the last actual Air Jordan. The shoe was released in th