usive',NULL,'Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow','Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow',NULL,NULL),(145,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(145,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(145,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(146,1,1,'<p>About Air Stab:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\n<p>Designer¬†: Tinker Hatfield</p>\r\n<p>This shoe featured Nike‚Äôs footbridge stability device. Big \"AIR STAB\" letters on the thermoplastic heelcap are best visible. Plus the forkstabs in the Air-window give this shoe an aggressive flavour. Nike stopped making the Air Stab in 1990 to the dismay of numerous fans. The Air Stab was designed by Tinker Hatfield.</p>','<p>Year of release: 2006</p>','air-stab-purple-green-red','Nike Air Stab Purple/Green/Red 2006',NULL,'Air Stab Purple/Green/Red','Air Stab Purple/Green/Red',NULL,NULL),(146,1,2,'<p>A propos de la Air Stab:</p>\r\n<p>Ann√©e de sortie du mod√®le original: 1988</p>\r\n<p>Designer¬†: Tinker Hatfield</p>\r\n<p>Cette chaussure poss√®de le dispositif de stabilit√© Nike Footbridge. Un tr√®s large lettrage AIR STAB au niveau de la protection thermoplastique du talon, plus la fourche Stab au niveau de la bulle d‚Äôair, donnant √† la chaussure un design agressif. Nike stoppa la fabrication de la Air Stab en 1990 au grand d√©sarroi de nombreux fans. Le design de la Air Stab a √©t√© con√ßu par Tinker Hatfield.</p>','<p>Ann√©e de sortie: 2006</p>','air-stab-purple-green-red','Nike Air Stab Purple/Green/Red 2006',NULL,'Air Stab Purple/Green/Red','Air Stab Purple/Green/Red',NULL,NULL),(146,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(146,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jord