 of release of OG Model: 1990</p>\r\n<p>There has been a lot of anticipation and discussion around this Nike Collector shoe release.</p>\r\n<p>This Andre Agassi classic first hit the scene in 1990. That year Andre Agassi lost 2 grand slams finals. The first in Roland Garros against the Ecuadorian Andres Gomez and the second at the U.S. Open against Pete Sampras. The Hot LAVA ATC II is probably the most sought after model in the entire Air Tech line. Nike did an excellent job on this retro which is almost identical to the original model.</p>','<p>Year of release: 2008</p>','air-tech-challenge-ii-hot-lava','Nike Air Tech Challenge II \"Hot Lava\" Agassi Retro 1990',NULL,'Air Tech Challenge II \"Hot Lava\"','Air Tech Challenge II \"Hot Lava\"',NULL,NULL),(384,1,2,'<p>Ann√©e de sortie: 2008</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Tech Challenge II:</p>\r\n<p>Ann√©e de sortie du mod√®le original: 1990</p>\r\n<p>Il y a eu beaucoup de discussions autour de la sortie de ce mod√®le embl√©matique de chez Nike.</p>\r\n<p>Ce grand classique fut port√© par Andre Agassi en 1990. Cette ann√©e-l√†, Agassi perdit 2 finales de Grand Chelem. La premi√®re √† Roland Garros contre l\'√âquatorien Andres Gomez et la deuxi√®me √† l\'US Open contre Pete Sampras. La Hot Lava est probablement le mod√®le le plus recherch√© dans la gamme Air Tech. Nike a fait un excellent travail sur cette r√©tro, en effet, la chaussure est quasi-identique √† l\'originale.</p>','<p>Ann√©e de sortie: 2008</p>','air-tech-challenge-ii-hot-lava','Nike Air Tech Challenge II \"Hot Lava\" Agassi Retro 1990',NULL,'Air Tech Challenge II \"Hot Lava\"','Air Tech Challenge II \"Hot Lava\"',NULL,NULL),(384,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(384,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(384,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tec