rdan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson‚Äôs Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2004</p>','air-jordan-vii-olympic-04','Nike Air Jordan VII Olympic \'04 AJ 7 2004 Deadstock Barcelona Olympics 1992 Gold Medal Dream Team',NULL,'Air Jordan VII Olympic \'04','Air Jordan VII Olympic \'04',NULL,NULL),(400,1,2,'<p>Ann√©e de sortie: 2004</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du mod√®le original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">A l‚Äôissue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2√®me titre NBA d‚Äôaffil√©e, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est √† nouveau d√©sign√© MVP de la finale NBA.</p>\r\n<p style=\"text-align: justify;\">Alliant les capacit√©s des chaussures de course et de nouvelles mati√®res plus l√©g√®res et plus confortables (n√©opr√®ne), la Air Jordan VII tient son design de la culture tribale. Le syst√®me Huarache, qui maintient le pied comme dans un chausson, est la grande √©volution. Il permet au <br />pied d\'√©pouser parfaitement la semelle. Un mod√®le sp√©cial blanc/bleu/rouge/argent a √©t√© cr√©√© pour les JO de Barcelone, avec le n¬∞9 (num√©ro de Michael Jordan au sein de la \"Dream Team\") imprim√© au niveau du talon.</p>',