jorit√© des mod√®les sign√©s par l\'artiste, la paire pr√©sente plusieurs nuances de bleu.</p>\r\n<p style=\"text-align: justify;\">Edition limit√©e.</p>','<p>Ann√©e de sortie: 2006</p>','air-max-95-x-stash','Nike Air Max 95 x Stash harbor blue/black-varsity royal-midnight navy 2006',NULL,'Air Max 95 x Stash','Air Max 95 x Stash',NULL,NULL),(401,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(401,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(401,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(402,1,1,'<p>Year of release: 1999</p>\r\n<p>Retro card and Nike Air tag included.</p>\r\n<p>OG box missing, delivered in a Jordan replacing box.</p>\r\n<p>¬†</p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the¬†Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous ¬´¬†Can/Can\'t¬†¬ª TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p style=\"text-align: justify;\">Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and¬† \"trapezoidal\" multi-port lace-locking system. visible Air Sole¬Æ unit in heel, encapsulated forefoot Air-Sole¬Æ unit.</p>','<p>Year of release: 1999</p>','air-jordan-iv-black-cement-99','Nike Air Jordan IV Black/Cement Grey \'99 retro AJ4 1999 Bred',NULL,'Air Jordan IV Black/Cement \'99','Air Jordan IV Black/Cement \'99',NULL,NULL),(402,1,2,