ange 2013 Blue Suede',NULL,'Asics Gel Lyte III Navy/Orange','Asics Gel Lyte III Navy/Orange',NULL,NULL),(424,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(424,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(424,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,1,'<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but some other players did, such as Penny Hardaway, Kendall Gill or Mitch Richmond. As MJ then decided to start a new career in Baseball, Nike created a version of the model with cleats.</p>\r\n<p>The shoe uses advanced technology: dynamic-Fit inner bootie, encapsulated Air-Sole unit (forefoot), large volume Air-Sole unit (heel), polyurethane midsole and ‚Äúone-pull‚Äù lacing system. Tinker Hatfield said he was inspired by Japanese design to create this model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like ¬´ freedom ¬ª, ¬´ independance ¬ª, ¬´ force ¬ª and ¬´ athletic ¬ª in several languages from every continent.</p>','<p>Year of release: 2012</p>','air-jordan-ix-motorboat-jones','Nike Air Jordan IX Motorboat Jones Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Motorboat Jones','Air Jordan IX Motorboat Jones',NULL,NULL),(425,1,2,'<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du mod√®le original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annonc√© sa retraite √† l‚Äô√¢ge de 30 ans (apr√®s le d√©c√®s de son p√®re, assassin√© en Caroline du Nord). Par cons√©quent, il s\'agit de la premi√®re Air Jordan qu‚Äôil n‚Äôait pas port√©e lors d‚Äôun match officiel, mais d‚Äôautres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l‚Äôont √©trenn√©e sur les parquets NBA. Comme MJ avait alors d√©cid√© de se lancer dans le baseball, Nike a sp√©cialement cr√©√© une version du mod√®le avec des crampons. La chaussure utilise des technologies avanc√©es: chausson interne ¬´ dynamique-Fit ¬ª, double syst√®me Air-Sole int√©gr√© (un √† l‚Äôavant-pied et un grand au talon), midsole en polyur√©thanne et syst√®me de la√ßage \"one pull\". Tinker Hatfield a dit s‚Äô√™tre inspir√© du design japonais pour la conception de ce mod√®le, une fa√ßon pour lui de montrer que MJ √©tait devenu une ic√¥ne dans le monde entier. Ceci est √©galement mis en avant sur les semelles qui comportent des mots comme ¬´libert√©¬ª, ¬´ind√©pendance¬ª, ¬´force¬ª et ¬´athl√©tique¬ª dans diff√©rentes langues venues des quatre coins du monde.</p>','<p>Ann√©e de sortie: 2012</p>','air-jordan-ix-motorboat-jones','Nike Air Jordan IX Motorboat Jones Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Motorboat Jones','Air Jordan IX Motorboat Jones',NULL,NULL),(425,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,1,'<p>¬†</p>\r\n<p style=\"text-align: justify;\">Year of release: 2012</p>\r\n<p style=\"text-align: justify;\">¬†</p>\r\n<p style=\"text-align: justify;\">About Pre Montreal Racer:</p>\r\n<p style=\"text-align: justify;\">Year of release of OG model: 1973</p>\r\n<p style=\"text-align: justify;\">Montreal racer is among the first running shoes released by Nike (after the Cortez). The \"Pre\" in the name of the shoe refers to American long distance runner Steve Prefontaine, who was trained by Bill Bowerman in Oregon University in the beginning of the 70\'s.</p>\r\n<p style=\"text-align: justify;\">In 1972, he set a new US record of the 5000m that allowed him to participate to Munich Olympic Games, but he did not succeed to win a medal, as he finished at the 4th place. After the race, he promised to win in Montreal in 1976. He was supposed to wear this running shoe in Montreal Olympics but was unfortunately killed in a car accident in 1975. He remains very famous in the US for being one of the first major long distance runners.</p>\r\n<p>¬†</p>','<p>Year of release: 2012</p>','pre-montreal-racer-vintage-blue-red-white','Nike Pre Montreal Racer Vintage Blue/Red/White Retro 2012',NULL,'Pre Montreal Racer Vintage Blue/Red/White','Pre Montreal Racer Vintage Blue/Red/White',NULL,NULL),(429,1,2,'<p>Ann√©e de sortie: 2012</p>\r\n<p>¬†</p>\r\n<p style=\"text-align: justify;\">A propos de la Pre Montreal Racer:</p>\r\n<p style=\"text-align: justify;\">Date de sortie du mod√®le original: 1973</p>\r\n<p style=\"text-align: justify;\">La Montreal racer fait partie des premiers mod√®les running sortis par Nike (apr√®s la Cortez). Le terme \"Pre\" dans le nom du mod√®le fait r√©f√©rence √†¬†Steve Prefontaine, star Am√©ricaine des courses de fond, entrain√© par Bill Bowerman (co-fondateur de Blue Ribbon Sport, devenu Nike en 1972) √† l\'Universit√© d\'Oregon au d√©but des ann√©es 1970.</p>\r\n<p style=\"text-align: justify;\">En 1972, il bat le record des Etats Unis du 5000m, ce qui lui permet d\'√™tre qualifi√© pour les Jeux Olympiques de Munich, o√π il ne gagnera pas de m√©daille et terminera √† la quatri√®me place. Apr√®s cette course, il promit de gagner √† Montreal en 1976. Il devait porter cette paire lors des Jeux Olympiques de Montreal mais il se tua dans un accident de voiture en 1975. Il reste tr√®s populaire aux Etats Unis pour avoir √©t√© parmi les premiers coureurs de fond am√©ricains.</p>','<p>Ann√©e de sortie: 2012</p>','pre-montreal-racer-vintage-blue-red-white','Nike Pre Montreal Racer Vintage Blue/Red/White Retro 2012',NULL,'Pre Montreal Racer Vintage Blue/Red/White','Pre Montreal Racer Vintage Blue/Red/White',NULL,NULL),(429,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(430,1,1,'<p>Year of release: 2013</p>\r\n<p>¬†</p>\r\n<p>About ZX 8000:<br />Year of release of OG Model:¬†1988</p>\r\n<p style=\"text-align: justify;\"><br />The Adidas ZX8000 was produced in 1988 and was the first in a series of Adidas shoes to use the company‚Äôs Torsion system, designed specifically to support the midfoot and allow movement. Not only does the system help to improve running technique, but it also reduces the volume of midsole material in the midfoot area, resulting in a lighter shoe. It is visble on the bottom of the outsole and can even be touched.</p>','<p>Year of release: 2013</p>','adidas-torsion-zx8000-laqua-blue-yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow 2013 running adi archive retro',NULL,'Adidas Torsion ZX8000 Laqua Blue/Yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow',NULL,NULL),(430,1,2,'<p>Ann√©e de sortie: 2013</p>\r\n<p>¬†</p>\r\n<p>A propos de la ZX 8000:<br />Ann√©e de sortie du mod√®le original: 1988</p>\r\n<p style=\"text-align: justify;\"><br />La ZX8000 a √©t√© produite en 1988 et a √©t√© la premi√®re √† utiliser le syst√®me Adidas torsion, con√ßu sp√©cifiquement pour soutenir la plante du pied et permettre le mouvement. Non seulement le syst√®me aide √† am√©liorer la technique de course, mais il r√©duit √©galement le volume de la semelle au niveau de la plante des pieds, permettant une grande l√©g√®ret√©. Ce syst