athability and reduce weight, plastic stabilisation lace straps and¬† \"trapezoidal\" multi-port lace-locking system. visible Air Sole¬Æ unit in heel, encapsulated forefoot Air-Sole¬Æ unit.</p>','<p>Year of release: 2013</p>','air-jordan-iv-fear-gs','Nike Air Jordan IV Fear GS Black/White/Cool Grey Nubuck Suede retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Fear GS','Air Jordan IV Thunder GS',NULL,NULL),(606,1,2,'<p>Ann√©e de sortie: 2013</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du mod√®le original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est s√©lectionn√© pour son 3<sup>√©me</sup> All-Star Game cons√©cutif et obtient son troisi√®me titre de meilleur marqueur de la saison r√©guli√®re. Le design de la Air Jordan IV n‚Äôest pas aussi r√©volutionnaire que celui du mod√®le pr√©c√©dent et garde l‚Äôesprit de la Air Jordan III. Avec ce mod√®le, les Air Jordan commencent √† conna√Ætre un succ√®s populaire important. Spike Lee (Mars Blackman) continue √† collaborer avec Nike et cr√©e des publicit√©s comme la c√©l√®bre ¬´¬†Can/ Can‚Äôt¬†¬ª et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moul√©es pour am√©liorer la respiration du pied et pour r√©duire le poids.</p>\r\n<p>Syst√®me de stabilisation en plastique.</p>\r\n<p>Syst√®me de verrouillage de lacets de forme trap√©zo√Ødale.</p>\r\n<p>Syst√®me air visible dans le talon, bulle d‚Äôair dissimul√©e √† l‚Äôavant du pied</p>','<p>Ann√©e de sortie: 2013</p>','air-jordan-iv-fear-gs','Nike Air Jordan IV Fear GS Black/White/Cool Grey Nubuck Suede retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Fear GS','Air Jordan IV Fear GS',NULL,NULL),(606,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(606,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(606,1,5,NULL,NULL,'air-jordan-i-low-phat-bl