d',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(632,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(633,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI ¬´ Carmine ¬ª, with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2012</p>','air-jordan-vi-olympic','Nike Air Jordan VI Olympic AJ 6 2012',NULL,'Air Jordan VI Olympic','Air Jordan VI Olympic',NULL,NULL),(633,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du mod√®le original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, apr√®s 7 saisons en NBA, Michael Jordan mena Chicago √† la victoire face aux Lakers (4 victoires √† 1) pour le premier titre NBA de l‚Äôhistoire du club. Tinker Hatfield demanda √† Michael Jordan ce qu‚Äôil d√©sirait pour la Air Jordan VI. Le souhait de MJ √©tait de pouvoir enfiler la chaussure plus facilement. C‚Äôest pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un ¬´ spoiler ¬ª au niveau sup√©rieur du talon. Le spoiler a √©t√© inspir√© par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est consid√©r√©e par beaucoup de collectionneurs comme l‚Äôune des plus belles paires de Air Jordan.</p>','<p>Ann√©e de sortie: 2012</p>','air-jordan-vi-olympic','