</p>','<p>Ann√©e de sortie: 2014</p>','air-jordan-vi-infrared-23-toro-gs','Nike Air Jordan VI Infrared 23 Toro GS AJ 6 2014 raging bull',NULL,'Air Jordan VI Infrared 23 \"Toro\" GS','Air Jordan VI Infrared 23 \"Toro\" GS',NULL,NULL),(888,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(888,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(888,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(891,1,1,'<p>Year of release: 2014</p>\r\n<p>¬†</p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.¬† Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker‚Äôs upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-essential-white-black-grey-blue','Nike Air Max 1 Essential White/Black/Grey/Blue AM1 2014',NULL,'Air Max 1 Essential White/Black/Grey/Blue','Air Max 1 Essential White/Black/Grey/Blue',NULL,NULL),(891,1,2,'<p>Ann√©e de sortie: 2014</p>\r\n<p>¬†</p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du mod√®le original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier syst√®me √† coussin d‚Äôair visible fabriqu√© par NIKE (d√©velopp√© par la NASA). Depuis 1987 l‚ÄôAir Max a √©t√© produit dans un tr√®s large choix de couleurs et de vari√©t√©s de mati√®res. La premi√®re version tout en cuir fut lanc√©e en 1988. Auparavant, les √©l√©ments de fabrication utilis√©s √©taient le nylon et le daim synth√©tiques.</p>','<p>Ann√©e de sortie: 2014</p>','air-max-1-essential-white-black-grey-blue','Nike Air Max 1 Essential White/Black/Grey/Blue AM1 2014',NULL,'Air Max 1 Essential White/Black/Grey/Blue','Air Max 1 Ess